import React from "react";
import { Link } from "react-router-dom";

import { Header, Footer } from "../components/index";

const Inventory = () => {
  return (
    <div>
      <Header />
      <div className="row">
        <div className="col-12 p-2">
          <h1># 500,000,000</h1>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default Inventory;
